Function Invoke-Rubeus 
{
<#
.SYNOPSIS
This is a simple PowerShell wrapper for Rubeus.exe.

.DESCRIPTION
This is a simple PowerShell wrapper for Rubeus.exe.

This function allows you to run Rubeus in memory and pass whatever parameters
you choose to it.

.PARAMETER Parameters
Rubeus parameters you wish to run.

.EXAMPLE

PS > Invoke-Rubeus -Parameters "/help"

Will display Rubeus help, the same as if you ran rubeus.exe /help

.LINK
https://github.com/reigningshells

#>
	[CmdletBinding()]
	param (
		[Parameter(Mandatory = $True)]
		[String]$Parameters
	)

	$RubeusExe = [Convert]::FromBase64String("")
	$Assembly = [System.Reflection.Assembly]::Load($RubeusExe)
	[Rubeus.Program]::Main("$Parameters".Split())
}
